      "https://m.media-amazon.com/images/I/21AbU2qtsJL._SS522_.jpg~https://m.media-amazon.com/images/I/21-lIZngjPL._SS522_.jpg~https://m.media-amazon.com/images/I/31g7XBmfqkL._SS522_.jpg~https://m.media-amazon.com/images/I/51mqYlWuw-L._SS522_.jpg~https://m.media-amazon.com/images/I/31g7XBmfqkL._SS522_.jpg~https://m.media-amazon.com/images/I/31nbm1Sqi4L._SS522_.jpg",
    overview: [],
    about_item:
      "„ÄêSafety Certificate„ÄëOnly for cat use. RvPaws Soft claw caps are made from natural vinyl resin, as Europe UNITASGS environmental certification, non-toxic. The glues have passed EU MSDS, safe and specially used for pet nail caps. Natural and comfortable, will not interfere with your cat's normal behavior. If the nail caps didn't fit your cat or you have anything questions to RvPaws cat nail covers, We support replacement or 100% refund. | „ÄêMultifunction„ÄëAnimals enter estrus and begin to get grumpy in spring. It is a good items to effectively prevention of cat scratch disease, beneficial to cat claw carry out care. Avoid cat scratches the affected area with skin disease, Protect your cat itself and protect you when play with them. You will never worried you will get hurt and it won't destroy you clothing. Protect your homes and furniture against destructive scratching by applying soft claws nail caps to kittens nails. | „ÄêHow to Use„ÄëThe soft nail covers can be applied on easily if two people cooperate. TIPS: 1. Correct size is important. Try one on without the glue, trim the open end of the nail cap if it's big. 2. Make sure that fur are separated with the paw 3. Use a little glue into the cap, about 1/3. More tips, Please refer to the detail description below. | „ÄêAfter Applying„ÄëUsually majority of cat can adapt quickly. Your cat maybe not adapt it when applied for the first time. Maybe he will bite or try to take it off, it's normal reaction of the cat, try to distract your cat. Each application will last 2 to 6 weeks until your cat naturally sheds their claws, However, the worn speed is different with cat breeds, cat's habits, please reapply when come off. | „ÄêPackage included„Äë100pcs (10 different colors) cat nail tips in 1 Pack with 5 Adhesive Glue + 5pcs Applicators. If you need to take the nail caps off from your cat claw, could use nail varnish remover or dispergator.",
    availability: "In stock.",
    description:
      "RvPaws Size Guide: XS:Fit for 16 weeks to 5 months of age or up to about 5.5 lb cat. S: Fit for 5.5-11 lb cat M: Fit for 11-16.5 lb cat L: Fit for 16.5 lb and up cat Application Steps: 1.Correct size is important.Take one of the nail caps out and try it on your cat's claws without the glue to ensure a proper snug fit. 2.Trim cat claws to the same length with that of the nail caps. If the nail cap is too large, you may trim the open end of the nail cap until it fits. Note: Do not trim kittens claws before applying nail caps. You will need a sufficient claw surface for the glue to adhere properly. 3.Fill each nail cap a little glue, only glue in a part of the nail(about 1/3, never fill to too full to prevent overflow of the adhesive), Wait the adhesive is half-dried in the nail cap. (Please be careful and avoid dropping glue on your hands or your cat's fur, if you do, remove it with use nail varnish remover or dispergator.) 4.Grasp the claws of your cat, slightly push aside the fur around the nail and expose the nail. Put the nail caps onto the claw and make sure they are completely wrapped. Wait until the adhesive is dry and continue with the next nail. 5.Observe your cat at least 5min to make sure nail caps are secure, then you have completed, We suggest you to distract your cat or feed his or her favorite food immediately after applying all nail caps. Notes: 1.Most cats will like their new claws, but some cats will reject. Generally, after wearing for the first few times, they will get used to them and without any discomfort. 2.Different cats, different movement and location (such as cement, grass, floor, carpet) etc., different wear rate of the nail caps. Some wearing 3-5 days may wear out. Some can wear 1-2 months or even longer. 3.Addition,The cat nails have scalability, we recommend you leave a little gap out when stick the nails, that cat nails have activity space.",
